import React from 'react';
import './App.css';

const profile = {
  name : 'The Nguyen',
  age : 20,
  gender: 'male',
  mobile : '123456',
  email : '123456@gmail.com',
  avatarUrl : 'https://cdn0.iconfinder.com/data/icons/avatar-78/128/3-512.png'
}


function App() {
  return (
    <div className="container bg-success vh-100">
        <h1 className="display-3 fw-bolder">Hello</h1>
        <div className="card" style={{ width: "18rem" }}>
          <img src={profile.avatarUrl} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title">{profile.name}</h5>
            <p className="card-text">
              Some quick example text to build on the card title and make up the bulk of
              the card's content.
            </p>
            <a href="#" className="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>

    </div>
  );
}

export default App;
